INSERT INTO `oc_t_pages_description` VALUES (1,'en_US','{WEB_TITLE} - Someone has a question about your listing','<p>Hi {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) left you a message about your listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>:</p><p>{COMMENT}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(1,'ja_JA','{WEB_TITLE} - あなたの広告に関して質問が寄せられています','<p>こんにちわ {CONTACT_NAME}さん!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) があなたの広告<a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>に関してメッセージを残しています。:</p><p>{COMMENT}</p><p>よろしくお願いします。</p><p>{WEB_LINK}</p>'),(2,'en_US','Please validate your {WEB_TITLE} account','<p>Hi {USER_NAME},</p><p>Please validate your registration by clicking on the following link: {VALIDATION_LINK}</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),(2,'ja_JA','あなたの{WEB_TITLE} アカウントの認証をしてください。','<p>こんにちわ、 {USER_NAME}さん。</p><p>こちらのリンクをクリックしてアカウントを認証してください: {VALIDATION_LINK}</p><p>ありがとうございました!</p><p>よろしくお願いします。</p><p>{WEB_LINK}</p>'),(3,'en_US','{WEB_TITLE} - Registration successful!','<p>Hi {USER_NAME},</p><p>You\'ve successfully registered for {WEB_LINK}.</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),(3,'ja_JA','{WEB_TITLE} - 登録に成功しました','<p>Hi {USER_NAME},</p><p>You\'ve successfully registered for {WEB_LINK}.</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),(4,'en_US','Look at what I discovered on {WEB_TITLE}','<p>Hi {FRIEND_NAME},</p><p>Your friend {USER_NAME} wants to share this listing with you <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Message:</p><p>{COMMENT}</p><p>Regards,</p><p>{WEB_TITLE}</p>'),(4,'ja_JA','{WEB_TITLE}でこんなものを見つけましたので、ぜひご覧ください。','<p>こんにちわ、 {FRIEND_NAME}さん,</p><p>あなたの友達である {USER_NAME} さんがこちらの広告をシェアしました。 <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>本文:</p><p>{COMMENT}</p><p>よろしくお願いします。</p><p>{WEB_TITLE}</p>'),(5,'en_US','{WEB_TITLE} - New listings in the last hour','<p>Hi {USER_NAME},</p><p>New listings have been published in the last hour. Take a look at them:</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),(5,'ja_JA','{WEB_TITLE} - 新規広告 in the last hour','<p>こんにちわ、 {USER_NAME}さん。</p><p>新しい広告が直近1時間の間に公開されました。確認はこちらから。:</p><p>{ADS}</p><p>-------------</p><p>通知機能をオフにするには、こちらのリンクをクリックしてください。: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),(6,'en_US','{WEB_TITLE} - New listings in the last day','<p>Hi {USER_NAME},</p><p>New listings have been published in the last day. Take a look at them:</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),(6,'ja_JA','{WEB_TITLE} - 新規広告 in the last day','<p>こんにちわ、 {USER_NAME}さん。</p><p>新しい広告が前の日に公開されました。確認はこちらから。:</p><p>{ADS}</p><p>-------------</p><p>通知機能をオフにするには、こちらのリンクをクリックしてください。: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),(7,'en_US','{WEB_TITLE} - New listings in the last week','<p>Hi {USER_NAME},</p><p>New listings have been published in the last week. Take a look at them:</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),(7,'ja_JA','{WEB_TITLE} - 新規広告 in the last week','<p>こんにちわ、 {USER_NAME}さん。</p><p>新しい広告が前の週に公開されました。確認はこちらから。:</p><p>{ADS}</p><p>-------------</p><p>通知機能をオフにするには、こちらのリンクをクリックしてください。: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),(8,'en_US','{WEB_TITLE} - New listings','<p>Hi {USER_NAME},</p><p>A new listing has been published, check it out!</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),(8,'ja_JA','{WEB_TITLE} - 新規広告','<p>こんにちわ、 {USER_NAME}さん。</p><p>新しい広告が公開されました。確認はこちらから。:</p><p>{ADS}</p><p>-------------</p><p>通知機能をオフにするには、こちらのリンクをクリックしてください。: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),(9,'en_US','{WEB_TITLE} - New comment','<p>Someone commented on the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Commenter: {COMMENT_AUTHOR}<br />Commenter\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p>'),(9,'ja_JA','{WEB_TITLE} - 新規コメント','<p>Someone commented on the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Commenter: {COMMENT_AUTHOR}<br />Commenter\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p>'),(10,'en_US','{WEB_TITLE} - Edit options for the listing {ITEM_TITLE}','<p>Hi {USER_NAME},</p><p>You\'re not registered at {WEB_LINK}, but you can still edit or delete the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> for a short period of time.</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>If you register as a user, you will have full access to editing options.</p><p>Regards,</p><p>{WEB_LINK}</p>'),(10,'ja_JA','{WEB_TITLE} - 広告{ITEM_TITLE}の編集オプション','<p>Hi {USER_NAME},</p><p>You\'re not registered at {WEB_LINK}, but you can still edit or delete the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> for a short period of time.</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>If you register as a user, you will have full access to editing options.</p><p>Regards,</p><p>{WEB_LINK}</p>'),(11,'en_US','{WEB_TITLE} - Validate your listing','<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because a listing has been published at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this email.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(11,'ja_JA','広告を認証してください','<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because a listing has been published at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this email.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(12,'en_US','{WEB_TITLE} - A new listing has been published','<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a listing has been published at {WEB_LINK}.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact email: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>You can edit this listing by clicking on the following link: {EDIT_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(12,'ja_JA','{WEB_TITLE} - 新しい広告が公開されました','<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a listing has been published at {WEB_LINK}.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact email: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>You can edit this listing by clicking on the following link: {EDIT_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(13,'en_US','{WEB_TITLE} - Recover your password','<p>Hi {USER_NAME},</p><p>We\'ve sent you this e-mail because you\'ve requested a password reminder. Follow this link to recover it: {PASSWORD_LINK}</p><p>The link will be deactivated in 24 hours.</p><p>If you didn\'t request a password reminder, please ignore this message. This request was made from IP {IP_ADDRESS} on {DATE_TIME}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(13,'ja_JA','{WEB_TITLE} - パスワードを復旧する','<p>Hi {USER_NAME},</p><p>We\'ve sent you this e-mail because you\'ve requested a password reminder. Follow this link to recover it: {PASSWORD_LINK}</p><p>The link will be deactivated in 24 hours.</p><p>If you didn\'t request a password reminder, please ignore this message. This request was made from IP {IP_ADDRESS} on {DATE_TIME}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(14,'en_US','{WEB_TITLE} - You requested an email change','<p>Hi {USER_NAME}</p><p>You\'re receiving this e-mail because you requested an e-mail change. Please confirm this new e-mail address by clicking on the following validation link: {VALIDATION_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(14,'ja_JA','{WEB_TITLE} - メールアドレスの変更リクエストがありました','<p>Hi {USER_NAME}</p><p>You\'re receiving this e-mail because you requested an e-mail change. Please confirm this new e-mail address by clicking on the following validation link: {VALIDATION_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(15,'en_US','{WEB_TITLE} - Please validate your alert','<p>Hi {USER_NAME},</p><p>Please validate your alert registration by clicking on the following link: {VALIDATION_LINK}</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),(15,'ja_JA','{WEB_TITLE} - アラートを認証してください','<p>こんにちわ、 {USER_NAME}さん。</p><p>こちらのリンクをクリックして、アラート登録の認証を行ってください: {VALIDATION_LINK}</p><p>ありがとうございます!</p><p>よろしくお願いいたします。</p><p>{WEB_LINK}</p>'),(16,'en_US','{WEB_TITLE} - Your comment has been approved','<p>Hi {COMMENT_AUTHOR},</p><p>Your comment on <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> has been approved.</p><p>Regards,</p><p>{WEB_LINK}</p>'),(16,'ja_JA','{WEB_TITLE} - コメントが承認されました','<p>こんにちわ、 {COMMENT_AUTHOR}さん。</p><p>広告 <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> に対するコメントが承認されました。</p><p>よろしくお願いします。</p><p>{WEB_LINK}</p>'),(17,'en_US','{WEB_TITLE} - Validate your listing','<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because you’ve published a listing at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this e-mail.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Even if you\'re not registered at {WEB_LINK}, you can still edit or delete your listing:</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(17,'ja_JA','広告を認証してください','<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because you’ve published a listing at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this e-mail.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Even if you\'re not registered at {WEB_LINK}, you can still edit or delete your listing:</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(18,'en_US','{WEB_TITLE} - A new user has registered','<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a new user has been created at {WEB_LINK}.</p><p>User details:</p><p>Name: {USER_NAME}<br />E-mail: {USER_EMAIL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(18,'ja_JA','{WEB_TITLE} - 新しいユーザーの登録がありました','<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a new user has been created at {WEB_LINK}.</p><p>User details:</p><p>Name: {USER_NAME}<br />E-mail: {USER_EMAIL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(19,'en_US','{WEB_TITLE} - Someone has a question for you','<p>Hi {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) left you a message:</p><p>{COMMENT}</p><p>Regards,</p><p>{WEB_LINK}</p>'),(19,'ja_JA','{WEB_TITLE} - 質問が寄せられています','<p>こんにちわ、 {CONTACT_NAME}さん!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) からのメッセージがあります。:</p><p>{COMMENT}</p><p>よろしくお願いします。</p><p>{WEB_LINK}</p>'),(20,'en_US','{WEB_TITLE} - Someone has commented on your listing','<p>There\'s a new comment on the listing: <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Author: {COMMENT_AUTHOR}<br />Author\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p><p>{WEB_LINK}</p>'),(20,'ja_JA','{WEB_TITLE} - あなたの広告に関してコメントがつけられました','<p>There\'s a new comment on the listing: <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Author: {COMMENT_AUTHOR}<br />Author\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p><p>{WEB_LINK}</p>'),(21,'en_US','{WEB_TITLE} - Success creating admin account!','<p>Hi {ADMIN_NAME},</p><p>The admin of {WEB_LINK} has created an account for you,</p><ul><li>Username: {USERNAME}</li><li>Password: {PASSWORD}</li></ul><p>You can access the admin panel here {WEB_ADMIN_LINK}.</p><p>Thank you!</p><p>Regards,</p>'),(21,'ja_JA','{WEB_TITLE} - 管理者アカウントを作成しました！','<p>こんにちわ、{ADMIN_NAME}、</p><p>{WEB_LINK}の管理者があなた用のアカウントを作成しました。</p><ul><li>ユーザー名: {USERNAME}</li><li>パスワード: {PASSWORD}</li></ul><p>管理パネルへのアクセスはこちらから。{WEB_ADMIN_LINK}.</p><p>ありがとうございました!</p><p>よろしくお願いします。</p>'),(22,'en_US','{WEB_TITLE} - Your ad is about to expire','<p>Hi {USER_NAME},</p><p>Your listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> is about to expire at {WEB_LINK}.'),(22,'ja_JA','{WEB_TITLE} - 広告はまもなく期限が切れます','<p>こんにちわ、 {USER_NAME}さん。</p><p>あなたの広告 <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> はまもなく掲載期限を向かえます。こちらから確認してください。 {WEB_LINK}.'),(23,'en_US','Service','<p>This is an example page description. This is a good place to put your Terms of Service or any other help information.</p>');
